  \"An Energy-Based Prognostic Framework to Predict Fatigue Damage Evolution in Composites\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-28T15:05:51.444335\",\n\t\"name\": \"an-energy-based-prognostic-framework-to-predict-fatigue-damage-evolution-in-composites\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this work, a prognostics framework to
  predict the evolution of damage in fiber-reinforced composites materials under fatigue
  loads is proposed. The assessment of internal damage thresholds is a challenge for
  fatigue prognostics in composites due to inherent uncertainties, existence of multiple
  damage modes, and their complex interactions. Our framework, considers predicting
  the balance of release strain energies from competing damage modes to establish
  a reference threshold for prognostics. The approach is demonstrated on data collected
  from a run-to-failure tension-tension fatigue experiment measuring the evolution
  of fatigue damage in carbon-fiber-reinforced polymer (CFRP) cross-ply laminates.
  Results are presented for the prediction of expected degradation by micro-cracks
  for a given panel with the associated uncertainty estimates.\",\n\t\"license_title\":
